import React from "react";
import "./App.css";
import "./Project.css";
import DoubleRow from "./components/DoubleRow";
import SingleRow from "./components/SingleRow";
import Project1 from './images/Project1.jpg';
import Project2 from './images/Project2.jpg';
import Project3 from './images/Project3.jpg';
import Project4 from './images/Project4.jpg';
import Project5 from './images/Project5.jpg';


function Projects() {

  return (
    <div className="About" >

          <div className='PageWrapper' >

            <div className="BodyRight" style={{paddingBottom:40}}>

            <p>Dive into our<span className="FirstSpan">Latest</span> <span className="SecondSpan">Design Projects </span></p>

            </div>

            <div>

                  <SingleRow 
                  name='Project' year='2021' img={Project3}/>




          </div>

          </div>






    </div>
  );
}

export default Projects;
